import React, { Component }from 'react';
import { BrowserRouter as Router, Route, Link } from "react-router-dom";
import ReactDOM from 'react-dom';
import 'antd/dist/antd.css';
import { Descriptions, Badge } from 'antd';
import './dashboard.css'
import GlobalDaily from "../global-daily/global-daily";
class Dashboard extends Component{
    render(): React.ReactNode {
        return(
            <Descriptions style={{marginLeft:"50px", width:"1000px"}}
                          title="User Info" layout="vertical" bordered>
                <Descriptions.Item label="Product">
                    <div style={{marginBottom:"20px"}}>Cloud Database</div>
                    <br/>
                    <div style={{marginBottom:"20px"}}>Cloud Database</div>
                    <br/>
                </Descriptions.Item>
                <Descriptions.Item label="Billing Mode">
                    <div style={{marginBottom:"20px"}}>Database version: 3.4 Package: dds.mongo.mid Storage space: 10 GB Replication factor: 3 Region: East China 1</div>
                    <br/>
                    <div style={{marginBottom:"20px"}}>Cloud Database</div>
                    <br/>

                </Descriptions.Item>
                <Descriptions.Item label="Automatic Renewal"><Link to="/globaldaily">YES</Link></Descriptions.Item>
                <Route exact path="/globaldaily" component={GlobalDaily} />

                <Descriptions.Item label="Config Info">
                    <text style={{color:"red", borderBottom:"2px solid black"}}>Data disk type: MongoDB</text>
                    <br style={{color:"black", height:"2px"}}/>
                    Database version: 3.4
                    <br />
                    Package: dds.mongo.mid
                    <br />
                    Storage space: 10 GB
                    <br />
                    Replication factor: 3
                    <br />
                    Region: East China 1<br />
                </Descriptions.Item>
            </Descriptions>
        );
    }
}

export default Dashboard
